for item in Ta[36:-34]:
    Ta_new.append(item-300)

Tas_new=smooth(Ta_new,100)
Tas=[]
for item in Tas_new:
    Tas.append(item*1.2+300)
Gs=smooth(G[36:-34],100)
Terr = calculate_error(Ta[36:-34],Tas)
Terrp = (Terr/Tas) *100
Gerr = calculate_error(G[36:-34],Gs)
Gerrp = (Gerr/Gs) *100
print(np.min(Terrp),np.max(Terrp),np.median(Terrp))
print(np.min(Gerrp),np.max(Gerrp),np.median(Gerrp))

